void wait_for_enter() {
    unsigned char last_byte = 0;
    while (1) {
        int data = PS2_DATA;
        int rvalid = data & 0x8000;

        if (rvalid) {
            last_byte = data & 0xFF;

            // ENTER key press (0x5A)
            if (last_byte == 0x5A) break;
        }

        for (volatile int delay = 0; delay < 10000; delay++); // Debounce
    }
}

