void swap(int *a, int *b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

void draw_line(int x0, int y0, int x1, int y1, short int color) {
    bool is_steep = (ABS(y1 - y0) > ABS(x1 - x0));

    if (is_steep) {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }

    if (x0 > x1) {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int dx = x1 - x0;
    int dy = ABS(y1 - y0);
    int error = -(dx / 2);
    int y = y0;
    int y_step = (y0 < y1) ? 1 : -1;

    for (int x = x0; x <= x1; x++) {
        if (is_steep)
            plot_pixel(y, x, color);
        else
            plot_pixel(x, y, color);

        error += dy;
        if (error > 0) {
            y += y_step;
            error -= dx;
        }
    }
}

void draw_number(int number, int player) {
    int digit_count = 0;
    int temp = number;

    // handle 0 case
    if (number == 0) {
        digit_count = 1;
    } else {
        // countdigits
        while (temp != 0) {
            temp /= 10;
            digit_count++;
        }
    }

    int counter = 1;
    
    // clear previous number display area and draw
    temp = number;
    for (int i = digit_count - 1; i >= 0; i--) {
        int digit = temp % 10;
        if (player == 0) {
            draw_digit(digit, MONEY1_LOCATION_X - (counter * 7), MONEY1_LOCATION_Y);
        } else {
            draw_digit(digit, MONEY2_LOCATION_X - (counter * 7), MONEY2_LOCATION_Y);
        }
        temp /= 10;
        counter++;
    }
    
    // draw the $ sign fixed position
    if (player == 0) {
        draw_char_scaled(MONEY1_LOCATION_X - 38, MONEY1_LOCATION_Y + 2, '$', COLOR_BLACK, 1);
    } else {
        draw_char_scaled(MONEY2_LOCATION_X - 38, MONEY2_LOCATION_Y + 2, '$', COLOR_BLACK, 1);
    }
}


void draw_blank_dice(int x, int y, int size) {
    int width = size * 5;

    // fill the dice area with white
    for (int dx = 0; dx < width; dx++) {
        for (int dy = 0; dy < width; dy++) {
            plot_pixel(x + dx, y + dy, WHITE);
        }
    }

    for (int i = 0; i < width; i++) {
        plot_pixel(x + i, y, COLOR_BLACK);                       // Top
        plot_pixel(x + i, y + width - 1, COLOR_BLACK);           // Bottom
        plot_pixel(x, y + i, COLOR_BLACK);                       // Left
        plot_pixel(x + width - 1, y + i, COLOR_BLACK);           // Right
    }
}

void draw_dice_dot(int cx, int cy, int radius) {
    for (int y = -radius; y <= radius; y++) {
        for (int x = -radius; x <= radius; x++) {
            if (x * x + y * y <= radius * radius) {
                plot_pixel(cx + x, cy + y, COLOR_BLACK);
            }
        }
    }
}

void draw_dice(int x, int y, int size, int value) {
    draw_blank_dice(x, y, size);  

    if (value < 1 || value > 6) {
        return;
    }

    int cx = x + size * 2 + size / 2;
    int cy = y + size * 2 + size / 2;
    int o = size + 1;
    int r = size / 2;

    switch (value) {
        case 1:
            draw_dice_dot(cx, cy, r);
            break;
        case 2:
            draw_dice_dot(cx - o, cy - o, r);
            draw_dice_dot(cx + o, cy + o, r);
            break;
        case 3:
            draw_dice_dot(cx - o, cy - o, r);
            draw_dice_dot(cx, cy, r);
            draw_dice_dot(cx + o, cy + o, r);
            break;
        case 4:
            draw_dice_dot(cx - o, cy - o, r);
            draw_dice_dot(cx + o, cy - o, r);
            draw_dice_dot(cx - o, cy + o, r);
            draw_dice_dot(cx + o, cy + o, r);
            break;
        case 5:
            draw_dice_dot(cx - o, cy - o, r);
            draw_dice_dot(cx + o, cy - o, r);
            draw_dice_dot(cx, cy, r);
            draw_dice_dot(cx - o, cy + o, r);
            draw_dice_dot(cx + o, cy + o, r);
            break;
        case 6:
            draw_dice_dot(cx - o, cy - o, r);
            draw_dice_dot(cx,     cy - o, r);
            draw_dice_dot(cx + o, cy - o, r);
            draw_dice_dot(cx - o, cy + o, r);
            draw_dice_dot(cx,     cy + o, r);
            draw_dice_dot(cx + o, cy + o, r);
            break;
    }
}

