void draw_chest(int x, int y, int w, int h) {
    int lid_height = h / 3;
    int base_height = h - lid_height;

    int border_color = 0x0000;     // Black
    int lid_color = 0x9240;        // Darker brown
    int base_color = 0xBC40;       // Golden brown
    int accent_color = 0xFCA0;     // Gold accent
    int lock_color = 0x0000;       // Black

    // Draw base (now top)
    draw_rect(x, y, w, base_height, base_color);

    // Draw lid (now bottom)
    draw_rect(x, y + base_height, w, lid_height, lid_color);

    // Outer border
    for (int i = 0; i < 2; i++) {
        draw_rect(x - i, y - i, w + 2 * i, 1, border_color);                  // Top
        draw_rect(x - i, y + h + i - 1, w + 2 * i, 1, border_color);          // Bottom
        draw_rect(x - i, y - i, 1, h + 2 * i, border_color);                  // Left
        draw_rect(x + w + i - 1, y - i, 1, h + 2 * i, border_color);          // Right
    }

    // Lid seam (divider line between base and lid)
    draw_rect(x, y + base_height - 1, w, 1, border_color);

    // Accent lines
    draw_rect(x + 2, y + base_height - 3, w - 4, 1, accent_color);           // base
    draw_rect(x + 2, y + h - 3, w - 4, 1, accent_color);                     // lid

    // Centered lock in base (move it down a bit)
    int lock_w = w / 6;
    int lock_h = base_height / 3;
    int lock_x = x + (w - lock_w) / 2;
    int lock_y = y + (base_height - lock_h) / 2;  // Moved lower for centering
    draw_rect(lock_x, lock_y, lock_w, lock_h, lock_color);

    // Optional keyhole dot
    plot_pixel(lock_x + lock_w / 2, lock_y + 1, accent_color);
}

