void draw_char_5x5(int x, int y, char c, short int color) {
    uint8_t index;
    
    if (c >= 'A' && c <= 'Z') {
        index = c - 'A';
    } else if (c >= 'a' && c <= 'z') {
        index = c - 'a'; 
    } else if (c >= '0' && c <= '9') {
        index = 26 + (c - '0');
    } else if (c == '$') {
        index = 36; 
    } else {
        return; 
    }
    
    if (index >= sizeof(font5x5)/sizeof(font5x5[0])) {
        return;
    }
    
    for (int row = 0; row < 5; row++) {
        uint8_t row_data = font5x5[index][row];
        for (int col = 0; col < 5; col++) {
            if (row_data & (0b10000 >> col)) {
                plot_pixel(x + col, y + row, color);
            }
        }
    }
}


void draw_string_5x5(int x, int y, const char *str, short int color) {
    int start_x = x;
    while (*str) {
        if (*str == '\n') {
            y += 6; 
            x = start_x;
        } else {
            draw_char_5x5(x, y, *str, color);
            x += 6; 
        }
        str++;
    }
}

void draw_char_8x8(int x, int y, char c, short int color) {
    if (c < 32 || c > 122) return; 
    
    for (int row = 0; row < 8; row++) {
        uint8_t row_data = font8x8[c-32][row];
        for (int col = 0; col < 8; col++) {
            if (row_data & (0x80 >> col)) { 
                plot_pixel(x + col, y + row, color);
            }
        }
    }
}

void draw_string_8x8(int x, int y, const char *str, short int color) {
    while (*str) {
        draw_char_8x8(x, y, *str, color);
        x += 8; 
        str++;
    }
}

