void draw_property_name(int x, int y, const char* text) {
    const int BOX_WIDTH = 63;  
    const int CHAR_WIDTH = 5;  
    const int CHAR_SPACING = 1;
    const int LINE_HEIGHT = 6;
    
    int text_width = strlen(text) * (CHAR_WIDTH + CHAR_SPACING) - CHAR_SPACING;
    
    if (text_width <= BOX_WIDTH) {
        int start_x = x + (BOX_WIDTH - text_width) / 2;
        draw_string_5x5(start_x, y + 14, text, 0x0000);
    } 
    else {
        int split_pos = strlen(text) / 2;
        

        while (split_pos > 0 && text[split_pos] != ' ') {
            split_pos--;
        }
        if (split_pos == 0) split_pos = strlen(text) / 2; 
        
        //line 1
        char line1[20] = {0};
        strncpy(line1, text, split_pos);
        int line1_width = strlen(line1) * (CHAR_WIDTH + CHAR_SPACING) - CHAR_SPACING;
        draw_string_5x5(x + (BOX_WIDTH - line1_width)/2, y + 10, line1, 0x0000);
        
        //line 
        const char* line2 = text + split_pos + (text[split_pos] == ' ' ? 1 : 0);
        int line2_width = strlen(line2) * (CHAR_WIDTH + CHAR_SPACING) - CHAR_SPACING;
        draw_string_5x5(x + (BOX_WIDTH - line2_width)/2, y + 10 + LINE_HEIGHT, line2, 0x0000);
    }
}

