void draw_electric_company_card(int x, int y) {
    // Card background and border
    draw_rect(x, y, 70, 125, WHITE);
    draw_line(x, y, x + 70, y, COLOR_BLACK);
    draw_line(x + 70, y, x + 70, y + 125, COLOR_BLACK);
    draw_line(x, y + 125, x + 70, y + 125, COLOR_BLACK);
    draw_line(x, y, x, y + 125, COLOR_BLACK);

    // Title text
    draw_string_5x5(x + (70 - 8 * 6) / 2, y + 5, "ELECTRIC", COLOR_BLACK);
    draw_string_5x5(x + (70 - 7 * 6) / 2, y + 13, "COMPANY", COLOR_BLACK);

    // Bulb position
    int cx = x + 35;
    int cy = y + 75;

    // Draw yellow bulb (circle)
    for (int dy = -5; dy <= 5; dy++) {
        for (int dx = -5; dx <= 5; dx++) {
            if (dx * dx + dy * dy <= 25) {
                plot_pixel(cx + dx, cy + dy, YELLOW);
            }
        }
    }

    // Predefined ray directions (8 rays at 45° intervals)
    const int ray_directions[8][2] = {
        { 0, -1},  // Up
        { 1, -1},  // Up-Right
        { 1,  0},  // Right
        { 1,  1},  // Down-Right
        { 0,  1},  // Down
        {-1,  1},  // Down-Left
        {-1,  0},  // Left
        {-1, -1},  // Up-Left
    };

    // Draw rays using integer multipliers
    for (int i = 0; i < 8; i++) {
        int dx = ray_directions[i][0];
        int dy = ray_directions[i][1];
        int start_x = cx + dx * 6;
        int start_y = cy + dy * 6;
        int end_x   = cx + dx * 9;
        int end_y   = cy + dy * 9;
        draw_line(start_x, start_y, end_x, end_y, COLOR_BLACK);
    }

    // Draw bulb base
    draw_rect(cx - 5, cy + 6, 10, 10, COLOR_BLACK);
    draw_line(cx - 10, cy + 16, cx + 10, cy + 16, COLOR_BLACK);
}

