void draw_char_4x4(int x, int y, char digit, short color) {
    const char digits[4][4][5] = {
        { // 1
            "  # ",
            "  # ",
            "  # ",
            "  # "
        },
        { // 2
            "####",
            "   #",
            "  # ",
            "####"
        },
        { // 3 
            "### ",
            "  # ",
            "   #",
            "### "
        },
        { // 4
            "#  #",
            "#  #",
            "####",
            "   #"
        }
    };

    if (digit < '1' || digit > '4') return;
    int index = digit - '1';

    for (int row = 0; row < 4; row++) {
        for (int col = 0; col < 4; col++) {
            if (digits[index][row][col] == '#') {
                plot_pixel(x + col, y + row, color);
            }
        }
    }
}

void draw_x(int x, int y, int size, short color) {
    for (int i = 0; i < size; i++) {
        plot_pixel(x + i, y + i, color);        
        plot_pixel(x + i, y + size - 1 - i, color); 
    }
}

void draw_house_on_board_tile(int tile_index, int number, int player, int isSpeical) {
    if (number < 1 || number > 4) return;

    int x = locationX[tile_index];
    int y = locationY[tile_index];

    // --- Adjust to center in color band ---
    if (tile_index < 10) {
        y += 20;
    } else if (tile_index < 20) {
        x -= 19;
        y += 2;
    } else if (tile_index < 30) {
        y -= 14;
    } else {
        x += 21;
        y += 2;
    }

    int square_size = 5;
    int tri_height = 2;
	
	if (isSpeical == 0){
		 // --- Draw triangle roof ---
		for (int i = 0; i < tri_height; i++) {
			if (player == 0){
				draw_line(x - i, y - tri_height + i, x + i, y - tri_height + i, COLOR_BLACK);
			}else{
				draw_line(x - i, y - tri_height + i, x + i, y - tri_height + i, WHITE);
			}

		}
		  // --- Green square base ---
		if (player == 0){
			 draw_rect(x - 2 , y, square_size, square_size, COLOR_BLACK);
		}else{
			 draw_rect(x - 2, y, square_size, square_size, WHITE);
		}
		
		draw_char_4x4(x - 2, y , '0' + number,  GREEN);
	}else if (isSpeical == 1){
		if (player == 0){
			draw_x(x-2, y-1, 6, COLOR_BLACK);
			
		}else{
			draw_x(x-2, y-1, 6, WHITE);
		}
		
	}

}


