void handle_jail_turn(int playerIndex) {
    if (players[playerIndex].getOutOfJailFreeCards > 0) {
        if (players[playerIndex].jailTurns == 1) {
            // Auto use on final turn
            printf("Automatically using Get Out of Jail Free card on final turn.\n");
            players[playerIndex].getOutOfJailFreeCards--;
            players[playerIndex].inJail = 0;
            players[playerIndex].jailTurns = 0;
            return;
        } else {
             printf("You have a Get Out of Jail Free card. Do you want to use it? [y/n]: ");
             while (1) {
				PS2_data = *PS2_ptr;
				RVALID = PS2_data & 0x8000;
				if (RVALID) {
					byte1 = byte2;
					byte2 = byte3;
					byte3 = PS2_data & 0xFF;
					if (byte3 == 0x35) {
						players[playerIndex].getOutOfJailFreeCards--;
						players[playerIndex].inJail = 0;
						players[playerIndex].jailTurns = 0;
						printf("You used a Get Out of Jail Free card. You are free now.\n");
						return;
					}
					else if (byte3 == 0x31) {  // N pressed
						printf("You chose not to get out of jail.\n");
						break;
					}

				}

			}
    
        }
    }

    int die1 = rand() % 6 + 1;
    int die2 = rand() % 6 + 1;
    //printf("Rolled %d and %d\n", die1, die2);
	//printf("Rolled %d and %d\n", die1, die2);
	//printf("Rolled %d and %d\n", die1, die2);
	//printf("Rolled %d and %d\n", die1, die2);
	

    if (die1 == die2) {
        printf("You rolled doubles! You are free and will move now.\n");
        players[playerIndex].inJail = 0;
        players[playerIndex].jailTurns = 0;
        move_player(playerIndex, die1 + die2);
        handle_tile_action(playerIndex);
        return;
    }
	int MONEY_LOCATION_X;
	int MONEY_LOCATION_Y;
	if (playerIndex == 0){
		MONEY_LOCATION_X = MONEY1_LOCATION_X;
		MONEY_LOCATION_Y = MONEY1_LOCATION_Y;
	}else{
		MONEY_LOCATION_X = MONEY2_LOCATION_X;
		MONEY_LOCATION_Y = MONEY2_LOCATION_Y;
	}

    players[playerIndex].jailTurns--;
	//printf("dsadasdasddasdadad\n", die1, die2);

    if (players[playerIndex].jailTurns == 0) {
        printf("You've served 3 turns. Paying $50 to get out of jail and moving.\n");
		
		clear_number(players[playerIndex].money, MONEY_LOCATION_X, MONEY_LOCATION_Y);
        players[playerIndex].money -= 50;
		draw_number(players[playerIndex].money, playerIndex);
        players[playerIndex].inJail = 0;
		
        move_player(playerIndex, die1 + die2);
        handle_tile_action(playerIndex);
    } else {
        printf("Do you want to pay $50 to get out of jail? [y/n]: ");
        while (1) {
			PS2_data = *PS2_ptr;
			RVALID = PS2_data & 0x8000;
			if (RVALID) {
				byte1 = byte2;
				byte2 = byte3;
				byte3 = PS2_data & 0xFF;
				if (byte3 == 0x35) {
					clear_number(players[playerIndex].money, MONEY_LOCATION_X, MONEY_LOCATION_Y);
					players[playerIndex].money -= 50;
					draw_number(players[playerIndex].money, playerIndex);
					
					players[playerIndex].inJail = 0;
					players[playerIndex].jailTurns = 0;
					move_player(playerIndex, die1 + die2);
					handle_tile_action(playerIndex);
					break;
				}
				else if (byte3 == 0x31) {  // N pressed
					printf("You chose not to get out of jail.\n");
					break;
				}

			}

		}
       
    }
	
	
}

int is_bankrupt(int playerIndex) {
    return players[playerIndex].money < 0;
}

void handle_tile_action(int playerIndex) {
	int MONEY_LOCATION_X;
	int MONEY_LOCATION_Y;
	if (playerIndex == 0){
		MONEY_LOCATION_X = MONEY1_LOCATION_X;
		MONEY_LOCATION_Y = MONEY1_LOCATION_Y;
	}else{
		MONEY_LOCATION_X = MONEY2_LOCATION_X;
		MONEY_LOCATION_Y = MONEY2_LOCATION_Y;
	}
	
	 if (players[playerIndex].position >= NUM_TILES) {
        players[playerIndex].position -= NUM_TILES;
        players[playerIndex].money += 200;
		
		clear_number(players[playerIndex].money, MONEY_LOCATION_X, MONEY_LOCATION_Y);
        printf("Player %d passed GO and received $200!\n", playerIndex + 1);
		draw_number(players[playerIndex].money, playerIndex);
    }
	unsigned char byte1 = 0;
	unsigned char byte2 = 0;
	unsigned char byte3 = 0;
	 //printf("aaaaaaaaaaaaaaaaaaaaaaaaaaaaa %d.\n", playerIndex);
    int pos = players[playerIndex].position;
    Tile *tile = &board[pos];
    printf("Player %d landed on %s\n", playerIndex + 1, tile->name);
	

    if (strcmp(tile->name, "Go To Jail") == 0) {
        printf("Go directly to Jail.\n");
        go_to_jail(playerIndex);
        return;
    }

    if (strcmp(tile->name, "Income Tax") == 0) {
        printf("Pay Income Tax of $200.\n");
		clear_number(players[playerIndex].money, MONEY_LOCATION_X, MONEY_LOCATION_Y);
		players[playerIndex].money -= 200;
		draw_number(players[playerIndex].money, playerIndex);
        return;
    }

    if (strcmp(tile->name, "Luxury Tax") == 0) {
        printf("Pay Luxury Tax of $100.\n");
		clear_number(players[playerIndex].money, MONEY_LOCATION_X, MONEY_LOCATION_Y);
        players[playerIndex].money -= 100;
		draw_number(players[playerIndex].money, playerIndex);
        return;
    }

    if (strcmp(tile->name, "Chance") == 0) {
        draw_chance_card(playerIndex);
        return;
    }

    if (strcmp(tile->name, "Community Chest") == 0) {
        draw_community_chest_card(playerIndex);
        return;
    }

    if (tile->price == 0) {
        printf("This is a special tile.\n");
        return;
    }

    if (tile->owner == -1) {
        printf("Property is unowned. Price: $%d. Rent: $%d\n", tile->price, tile->rent);
		printf("Do you want to buy %s? [y/n]: \n", tile->name);
        
        
        while (1) {
			PS2_data = *PS2_ptr;
       		RVALID = PS2_data & 0x8000;
			if (RVALID) {
				byte1 = byte2;
				byte2 = byte3;
				byte3 = PS2_data & 0xFF;
				if (byte3 == 0x35) {  // Y pressed
					if (players[playerIndex].money >= tile->price) {
						clear_number(players[playerIndex].money, MONEY_LOCATION_X, MONEY_LOCATION_Y);
						players[playerIndex].money -= tile->price;
						draw_number(players[playerIndex].money, playerIndex);
						tile->owner = playerIndex;
						players[playerIndex].properties[pos] += 1;
						printf("You bought %s!\n", tile->name);
						tile->houses++;
						
						if (pos == 5 || pos == 15 || pos == 25 || pos == 35 || pos == 12 || pos == 28){
							draw_house_on_board_tile(pos, players[playerIndex].properties[pos], playerIndex, 1);
						}else{
							draw_house_on_board_tile(pos, players[playerIndex].properties[pos], playerIndex, 0);
						}
						
					} else {
						printf("Not enough money.\n");
					}
					break;
				}
				else if (byte3 == 0x31) {  // N pressed
					printf("You chose not to buy %s.\n", tile->name);
					break;
				}
				
			}
            
        }
		
    } else if (tile->owner != playerIndex) {
        int rent = tile->rent;
        if (tile->houses > 0)
            rent += tile->houses * 10;
        if (tile->hotels > 0)
            rent += tile->hotels * 50;
        printf("This property is owned by Player %d.\n", tile->owner + 1);
        if (tile->houses > 0)
        	printf("This property has %d house(s).\n", tile->houses);
    	if (tile->hotels > 0)
        	printf("This property has %d hotel(s).\n", tile->hotels);

    	printf("You must pay $%d in rent.\n", rent);
		clear_number(players[playerIndex].money, MONEY_LOCATION_X, MONEY_LOCATION_Y);
		players[playerIndex].money -= rent;
		draw_number(players[playerIndex].money, playerIndex);
		
		int a;
		if (playerIndex == 1) a = 0;
		else a = 1;
		
		if (playerIndex == 0){
			MONEY_LOCATION_X = MONEY2_LOCATION_X;
			MONEY_LOCATION_Y = MONEY2_LOCATION_Y;
		}else{
			MONEY_LOCATION_X = MONEY1_LOCATION_X;
			MONEY_LOCATION_Y = MONEY1_LOCATION_Y;
		}
		
		clear_number(players[a].money, MONEY_LOCATION_X, MONEY_LOCATION_Y);
        players[tile->owner].money += rent;
		draw_number(players[a].money, a);
    } else{
        printf("You already own this property %d.\n", playerIndex);
		
		// Disallow building on Railroads and Utilities
        if (strcmp(tile->name, "Reading Railroad") == 0 ||
            strcmp(tile->name, "Pennsylvania Railroad") == 0 ||
            strcmp(tile->name, "B. & O. Railroad") == 0 ||
            strcmp(tile->name, "Short Line") == 0 ||
            strcmp(tile->name, "Electric Company") == 0 ||
            strcmp(tile->name, "Water Works") == 0) {
            printf("You cannot build houses or hotels on this property.\n");
            return;
        }
		 printf("Do you want to build a house on %s for $ %d? [y/n]: ", tile->name, 100);
		 printf("You already own this prosadadsadperty %d.\n", tile->houses);
		
        if (tile->houses < 4){
          
            while (1) {
				PS2_data = *PS2_ptr;
				RVALID = PS2_data & 0x8000;
				if (RVALID) {

					byte1 = byte2;
					byte2 = byte3;
					byte3 = PS2_data & 0xFF;
					if (byte3 == 0x35) {  // Y pressed
						if (players[playerIndex].money >= HOUSE_COST) {
					
							clear_number(players[playerIndex].money, MONEY_LOCATION_X, MONEY_LOCATION_Y);
							players[playerIndex].money -= HOUSE_COST;
							draw_number(players[playerIndex].money, playerIndex);

							tile->houses++;
							printf("House built on %s. Total houses: %d\n", tile->name, tile->houses);
							draw_house_on_board_tile(pos, tile->houses, playerIndex, 0);
						} else {
							printf("Not enough money to build a house.\n");
						}
						break;
					}
					else if (byte3 == 0x31) {  // N pressed
						printf("You chose not to buy %s.\n", tile->name);
						break;
					}

				}
			}

			
		
        } else {
            printf("This property has maxium houses.\n");
        }
    }
	
	
	//printf("endendendendneed\n");
}

void go_to_jail(int playerIndex) {
	int currentX = players[playerIndex].position, currentY = players[playerIndex].position;
	clear_piece(currentX, currentY, playerIndex+1);
    players[playerIndex].position = 10;
	currentX = 10;
	currentY = 10;
	draw_piece(currentX, currentY, playerIndex+1);
	
    players[playerIndex].inJail = 1;
    players[playerIndex].jailTurns = 3;
    players[playerIndex].consecutiveDoubles = 0;
}

void print_status() {
    for (int i = 0; i < 2; i++) {
        printf("Player %d: Position %d (%s) | Money: $%d | Jail: %s | Get Out of Jail Free Cards: %d\n",
               i + 1,
               players[i].position, board[players[i].position].name,
               players[i].money,
               players[i].inJail ? "Yes" : "No",
               players[i].getOutOfJailFreeCards);
    }
}



